['\begin{equation}
\beta(r)\equiv -\frac{1}{c}\frac{\mathrm{d} r}{\mathrm{d} T}(r).
\label{betaDefinition}
\end{equation}', 'Both sides are readily integrated up; we can solve the result for $\beta(r)$ and obtain
\begin{equation}
\beta(r) = \sqrt{
-\frac{2C}{r} +2D
},
\end{equation}', "with a constant $C$. Note that the constant $C$ can be negative --- there is no reason the constant $C'$ needs to be real; only our eventual function $B(r)$ needs to be that, and it is clear that (\ref{BSolution}) satisfies the differential equation
(\ref{VolumeConditionR}) for any constant $C$, positive, zero, or negative. By (\ref{BigBDefinition}), the solution (\ref{BSolution}) corresponds to the differential equation
\begin{equation}
\beta(r)\beta'(r) = \frac{C}{r^2}
\end{equation}
for our function $\beta$; with another separation of variables, we can re-write this as 
\begin{equation}
\beta\cdot\mathrm{d}\beta=C\frac{\mathrm{d} r}{r^2}.
\end{equation}", "\frac{\mathrm{d}^2 r}{\mathrm{d} T^2} = -c\frac{\mathrm{d}\beta}{\mathrm{d} T}=-c\beta' \frac{\mathrm{d} r}{\mathrm{d} T} = c^2\beta\cdot\beta',
\end{equation}
where the prime denotes differentiation of $\beta$ with respect to its argument. Since, in the following, the product of $\beta$ and its first derivative will occur quite often, let us introduce the abbreviation
\begin{equation}
B(r) \equiv \beta(r)\cdot\beta'(r).
\label{BigBDefinition}
\end{equation}
With these results, can rewrite the Taylor expansion (\ref{TaylorREvo}) as 
\begin{equation}
r(T) = r_0 -c\beta(r_0)\cdot\Delta T + \frac12 c^2B(r_0)\cdot\Delta T^2.
\label{RadialOrbitTime}
\end{equation}", "In order to find $r_C(T)$ for our central particle, we simply insert $r_0=R$ into that expression. If, on the other hand, we want to write down the time evolution for particles $U$ and $D$, let us denote it by $r_{U,D}(T)$, we need to evaluate the expression (\ref{RadialOrbitTime}) at the initial location $r_0=R\pm\Delta l$. Since $\Delta l$ is small, we can make a Taylor expansion of $\beta(r)$ and its derivative around $r=R$, and neglect everything beyond the terms linear in $\Delta l$. The result is
\begin{multline}
r_{U,D}(T)=R \pm\Delta l-c\left[
\beta(R)\pm\beta'(R)\Delta l
\right]\Delta T \\[0.2em]
+\frac{c^2}{2}\big[
B(R)\pm B'(R)\Delta l
\big]\Delta T^2
\end{multline}"]

