['The dynamical behaviour of the anisotropic order parameter  $m$ [see Eq.~\eqref{eq:def-m} in the Letter] following a quench to the critical point is well described by
the Gaussian theory for all the three lattice gas models studied, $i.e.,$ driven lattice gas with either constant (IDLG) or random (RDLG) infinite drive and equilibrium lattice gas (LG). In other words, in the short-time regime, $m \sim t^{1/2}$ [see Eq. \eqref{eq:mt}] and the Binder cumulant $g$ of the lowest transverse mode [defined in Eq. \eqref{eq:binder}] is zero in this regime. The alternative order parameter $O,$ however, distinguishes between the driven (IDLG, RDLG) and the equilibrium (LG) lattice gases.', '\section*{Dynamical Behaviour of $O$ in Lattice Gases}', 'Accordingly, the different dynamical behaviour of $O$, which involves a sum over all modes, can be attributed to the non-Gaussian nature of the higher modes in the LG. 
Such a departure is not entirely surprising. In fact, for higher modes, mesoscopic descriptions such as the ones in Eqs. \eqref{eq:L-DLG} or \eqref{eq:g_evol} are not expected to hold, while the anisotropy at the microscopic level could be the mechanism leading to the Gaussianity of higher modes in the driven models.', 'On the other hand,  Eq.~\eqref{eq:alpha} predicts $\alpha = 1/10$ upon substituting the values of the critical exponents corresponding to the Ising  universality class (LG). This is consistent with the numerical simulation results presented in the main text, see Fig. \ref{fig:ising}(b) therein.

